const tasks = [
    {
        id:1,
        text: 'text-1',
    },
    {
        id:2,
        text:'text-2',
    }
]
const Tasks = () => {
    return (
        <>
            {tasks.map((task) =>(
            <h3 key={task.id}>{task.text}</h3>
            ))}
        </>
    )
}

export default Tasks
